@faithc  and @ccleeton two things: 
1. We should move the FAQs into LibAnswers. https://faq.library.princeton.edu/special-collections/
2. The Statement on AV Materials link should have the same title, but it's about Digitization and Publication Services. This is not good UX. Can we include the copy in the Finding Aids site? Also, "AV" should be spelled out (or at least use periods) as per the [University's Editorial Styleguide](https://communications.princeton.edu/guides-tools/princeton-editorial-style-guide#abbreviations).

I think both these examples are an example of search UI issues rather than indexing. For the first one, there's a keyword search for "World Press Freedom Committee" - I guess searching the collection title doesn't return the components in that collection. Should it? If I just use the collection facet, I get the proper 81: https://findingaids-beta.princeton.edu/?f%5Bcollection_sim%5D%5B%5D=World+Press+Freedom+Committee+Records%2C+1921-2009%2C+bulk+1975%2F2009&f%5Bhas_direct_online_content_ssim%5D%5B%5D=online&group=true&search_field=all_fields

The second is a similar issue (which is replicated in findingaids) - if I search "editorial cartoons" there's only 4 results. If I facet to the political cartoon collection, I get 1000. https://findingaids-beta.princeton.edu/?f%5Bcollection_sim%5D%5B%5D=Political+Cartoon+Collection%2C+1889-1944&f%5Bhas_direct_online_content_ssim%5D%5B%5D=online&group=true&q=&search_field=all_fields. Editorial cartoons is a subject heading at the collection level, so all the components aren't returning (see also https://findingaids.princeton.edu/?v1=Editorial+cartoons&f1=kw&b1=AND&v2=&f2=kw&b2=AND&v3=&f3=kw&year=before&ed=&ld=&rpp=10&start=0) 

@faithc @ccleeton What should we do here?
